int main()
{
	int i, N, M, X[100001];
	data d;
	min_heap h;
	h.size = 0;
	scanf("%d %d", &N, &M);
	for (i = 1; i <= N; i++) scanf("%d", &(X[i]));
	for (i = 1; i <= M; i++) {
		scanf("%d %d %d", &(d.u), &(d.w), &(d.key));
		push(d, &h);
	}

	int ans = 0, r[3], vio[100001] = {};
	long long sum[100001];
	UF_forest F;
	UF_initialize(&F, N);
	for (i = 1; i <= N; i++) sum[i] = X[i];
	while (h.size > 0) {
		d = pop(&h);
		r[0] = UF_root(&F, d.u);
		r[1] = UF_root(&F, d.w);
		if (r[0] == r[1]) {
			if ((long long)d.key > sum[r[0]]) {
				vio[r[0]]++;
				ans++;
			}
		} else {
			r[2] = UF_merge(&F, r[0], r[1]);
			sum[r[2]] = sum[r[0]] + sum[r[1]];
			if ((long long)d.key > sum[r[2]]) {
				vio[r[2]] = vio[r[0]] + vio[r[1]] + 1;
				ans++;
			} else {
				ans -= vio[r[0]] + vio[r[1]];
				vio[r[2]] = 0;
			}
		}
	}

	printf("%d\n", ans);
	fflush(stdout);
	return 0;
}
